import logo from "./logo.svg";
import "./App.css";

function App() {
  const domain = "http://localhost:3001/data";
  const getContents = () => {
    fetch(domain + `?page=${currentpage}&size=5`)
      .then((res) => res.json())
      .then((data) => {
        setContents(data.data);
        setPageInfo(data.pageInfo);
        console.log(data);
      })
      .catch((e) => {
        console.log(`에러 캐치 ${e}`);
      });
  };

  useEffect(() => {
    getContents();
  }, [currentpage]);
  return <div className="App"></div>;
}

export default App;
